import Container from "react-bootstrap/Container"

function HiPyNavbar(props) {

    return (
        <Navbar>
            <Container>
                <Navbar.Brand>HiPy Resources</Navbar.Brand>
            </Container>
        </Navbar>
    )
}


export default HiPyNavbar
